import React from 'react';
import SignupForm from './components/SignupForm';

class App extends React.Component{
  constructor(props){
    super(props);
    this.state = {}
  }




  componentDidMount(){
    fetch("/api").then(res => res.json()).then(data => this.setState({data}))
  }

  render(){
    <div className='App'>
      <SignupForm />
    </div>

  }
}

export default App;
